import React from "react";
//import PropTypes from "prop-types";

const Edit = props => {
  return (
    <div>
      <p>Edit student name</p>
      <p>Old name: {props.student.name}</p>
      <form>
        <input type="text" value={props.newName} onChange={props.changeName} />
        <input type="button" onClick={props.editStudent}>
          Submit
        </input>
      </form>
      <button onClick={props.returnToList}>Cancel</button>
    </div>
  );
};

export default Edit;
